import React from 'react';
import './Follow.css'




const Follow = ({flag} ) =>{
    if (flag) {
        return (<button id="unfollow-btn" >UNFOLLOW</button>);
    }
    else{
        return (<button id="unfollow-btn" className='buttons'>FOLLOW</button>);
    }  
}

export default Follow;
